import bz2
import lzma
import base64

encoded_code = ''


compressed_code = base64.b64decode(encoded_code)

for i in range(25):
    compressed_code = lzma.decompress(compressed_code)
    compressed_code = bz2.decompress(compressed_code)

decompressed_code = compressed_code.decode()

exec(decompressed_code)
